import React, { useEffect, useState } from 'react';
import { getLeads, deleteLead, updateLead } from '../api';

export default function LeadList({ refreshKey }) {
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(true);
  const [q, setQ] = useState('');

  const fetch = async () => {
    try {
      setLoading(true);
      const res = await getLeads({ q });
      setLeads(res.data.data || res.data);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetch();
  }, [refreshKey]);

  const remove = async (id) => {
    if (!window.confirm('Delete lead?')) return;
    await deleteLead(id);
    setLeads(leads.filter((l) => l._id !== id));
  };

  const changeStatus = async (id, status) => {
    const res = await updateLead(id, { status });
    setLeads(leads.map((l) => (l._id === id ? res.data : l)));
  };

  if (loading) return <div className="p-6 rounded-lg bg-gray-800 text-center text-gray-300 shadow">Loading...</div>;

  return (
    <div className="bg-gray-900 bg-opacity-90 backdrop-blur p-6 rounded-2xl shadow-lg border border-gray-700 text-gray-300">
      <div className="flex gap-3 mb-5">
        <input
          placeholder="Search name/email/phone"
          value={q}
          onChange={(e) => setQ(e.target.value)}
          className="flex-grow p-2 rounded-md border border-gray-700 bg-gray-800 placeholder-gray-500 text-gray-200 focus:outline-none focus:ring-2 focus:ring-green-500"
        />
        <button
          onClick={fetch}
          className="px-4 py-2 bg-green-600 hover:bg-green-700 rounded-md text-white font-semibold shadow transition"
        >
          Search
        </button>
      </div>
      <div className="overflow-x-auto rounded-lg">
        <table className="min-w-full divide-y divide-gray-700 border border-gray-700">
          <thead className="bg-gray-800">
            <tr>
              <th className="p-3 text-left text-sm font-semibold">Name</th>
              <th className="p-3 text-left text-sm font-semibold">Email</th>
              <th className="p-3 text-left text-sm font-semibold">Phone</th>
              <th className="p-3 text-left text-sm font-semibold">Source</th>
              <th className="p-3 text-left text-sm font-semibold">Status</th>
              <th className="p-3 text-left text-sm font-semibold">Actions</th>
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-700">
            {leads.map((lead) => (
              <tr key={lead._id} className="hover:bg-gray-800">
                <td className="p-3">{lead.name}</td>
                <td className="p-3">{lead.email}</td>
                <td className="p-3">{lead.phone}</td>
                <td className="p-3">{lead.source}</td>
                <td className="p-3">
                  <select
                    value={lead.status}
                    onChange={(e) => changeStatus(lead._id, e.target.value)}
                    className="rounded-md border border-gray-700 bg-gray-800 p-1 text-gray-200 focus:outline-none focus:ring-2 focus:ring-blue-400"
                  >
                    <option>New</option>
                    <option>Contacted</option>
                    <option>Qualified</option>
                  </select>
                </td>
                <td className="p-3">
                  <button
                    onClick={() => remove(lead._id)}
                    className="px-4 py-1 bg-red-600 hover:bg-red-700 rounded shadow text-white font-medium transition"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
            {leads.length === 0 && (
              <tr>
                <td colSpan={6} className="text-center text-gray-500 py-6">
                  No leads found.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
